// ==UserScript==
// @name         GBF Victory Skip Auto
// @version      20190126.1
// @description  Redirects to reward page when win scenario is detected
// @match        http://game.granbluefantasy.jp/
// @grant        unsafeWindow
// @run-at       document-start
// @namespace    https://greasyfork.org/users/18331
// @downloadURL https://update.greasyfork.org/scripts/388186/GBF%20Victory%20Skip%20Auto.user.js
// @updateURL https://update.greasyfork.org/scripts/388186/GBF%20Victory%20Skip%20Auto.meta.js
// ==/UserScript==
const DEBUG = false;
const AUTO = true;
const REDIRECT_TO_SUMMON_SELECTION = true;

const tryParseJSON = text => {
    let json;
    try {
        json = JSON.parse(text);
    } catch (e) {
        if (e instanceof SyntaxError) {
            return text;
        }
        throw e;
    }
    return json;
};

const log = (...args) => {
    if (!DEBUG) return;
    console.debug("GVS", ...args);
};

const playCoinSound = () => {
    const sfx = "data:audio/wav;base64,";
    const audio = new Audio(sfx);
    audio.volume = 0.25;
    audio.play();
}

const playPowerupSound = () => {
    const sfx = "data:audio/wav;base64,";
    const audio = new Audio(sfx);
    audio.volume = 0.05;
    audio.play();
}

const customLoad = (xhr, ...args) => {
    // ex:
    // http://game.granbluefantasy.jp/rest/multiraid/ability_result.json
    const url = new URL(xhr.responseURL);
    const req = tryParseJSON(args[0]);
    const res = tryParseJSON(xhr.response);

    // Reward XHR Check
    if (
        url.pathname.indexOf('/result/data') >= 0 ||
        url.pathname.indexOf('/resultmulti/data') >= 0
    ) {
        log(" FOUND REWARD PAGE");
        //playCoinSound();

        const appearance = res.appearance;
        if (appearance) {
            log(" FOUND NM RAID");
            playPowerupSound();
        } else {
            if (REDIRECT_TO_SUMMON_SELECTION) {
                history.back();
                history.back(); // Standard
                //history.back(); // 2 Round
                //history.back(); // 3 Round
                window.setTimeout(()=>{ location.reload();}, 100);
            }
        }
        return;
    }

    // Combat XHR Check
    if (url.pathname.indexOf('.json') < 0) return;
    if (url.pathname.indexOf('/rest') < 0) return;
    log(" FOUND MATCHING REQUEST");

    if (!res.scenario) return;
    log(" FOUND SCENARIO", res.scenario);

    const win = res.scenario.find(s => s.cmd === "win");
    if (win) {
        log(" DETECTED WIN CONDITION", win);
        const raidId = win.raid_id;                            // Contains the next raid id if it's not the last round
        const isLastRaid = !!win.is_last_raid;

        log(" CURRENT_URL ", location.href.toString());
        const redirectURL = (isLastRaid) ?
              location.href.toString().replace("raid", "result") :
              location.href.toString().replace(/\d{3,10}/, raidId);
        log(" REDIRECT_URL", redirectURL);

        location.href = redirectURL;

        log(" REINITIALIZING");
        init();
    }
};

const origSend = unsafeWindow.XMLHttpRequest.prototype.send;

const main = () => {
    unsafeWindow.XMLHttpRequest.prototype.send = function (...args) {
        this.addEventListener('load', () => {
            if (this.status === 200) {
                customLoad(this, args);
            }
        });
        origSend.apply(this, args);
    };
};

const toggleAutoOn = () => {
    if (!AUTO) return;
    unsafeWindow.auto_flag = true;
    unsafeWindow.stage.gGameStatus.auto_attack = true;
    log("FORCED AUTO FLAG");
};

const init = () => {
    main();
    toggleAutoOn();
};

init();